import React from 'react';
import classes from "./Dialogs.module.css"
import DialogItem from './DialogItem/DialogItem';
import Message from './Message/Message';

const Dialogs = (props) => {
    let dialogs = [
        { id: 1, name: "Sasha" },
        { id: 2, name: "Ira" },
        { id: 3, name: "Nadia" },
        { id: 4, name: "Olya" },
        { id: 5, name: "Lena" },
    ]

    let messages = [
        {message:"HI"},
        {message:"MY NAME IS SASHA"},
        {message:"I LOVE KLYMENKO SO MUCH!"},
    ]

    let MessageElement = messages.map( message => <Message message={message.message} />)
    let DialogElements = dialogs.map(dialog => <DialogItem name={dialog.name} id={dialog.id} />);
    return (
        <div className={classes.dialogs}>
            <div className={classes.dialogsItems}>
                {DialogElements}
            </div>
            <div className={classes.messages}>
                {MessageElement}
            </div>
        </div>
    );
}

export default Dialogs;
